import React, { useState } from 'react'
import {Slider} from '@material-ui/core'



export default function App() {


    const mark=[
      {
        value:0,
        label:'start',
      },
      {
        value:100,
        label:'middle',
      },
      {
        value:200,
        label:'stop',
      },
    ]



  return (
    <div>
              <div style={{width:'300px',marginLeft:'30px'}}>
                       <Slider color='secondary' defaultValue={90} max={200} marks={mark}/>
              </div>

    </div>
  )
}
